import React from 'react';
import { connect } from 'react-redux';


const AnswerBoxes = (props) => {

  const renderAnswers = () => {
    if (!props.question) {
      console.log("No question")
      return <div></div>
    } else {
      console.log(props.question.results[0].incorrect_answers)
      return props.question.results[0].incorrect_answers.map(choice => {
        return <div>{choice}</div>
      })
    }
  }
  return (
    <div>
      {renderAnswers()}
    </div>
  )
}

const mapStateToProps = state => {
  return {
    quesiton: state.question
  }
}

export default connect(mapStateToProps)(AnswerBoxes);
